DROP TABLE IF EXISTS `rsq_pay_record`;
CREATE TABLE `rsq_pay_record` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `create_by` varchar(32) DEFAULT NULL COMMENT '创建者',
  `create_date` varchar(19) DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(32) DEFAULT NULL COMMENT '更新者',
  `update_date` varchar(19) DEFAULT NULL COMMENT '更新时间',
  `del_flag` varchar(1) NOT NULL DEFAULT '0' COMMENT '删除标记（0：正常；1：删除）',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `pay_date` varchar(19) NOT NULL COMMENT '充值时间',
  `pay_type` varchar(255) NOT NULL COMMENT '用户类型',
  `plateform` varchar(255) NOT NULL COMMENT '充值类型',
  `price` varchar(255) NOT NULL COMMENT '价格（自付费）',
  `team_name` varchar(255) NOT NULL COMMENT '团队/个人名称',
  `contacts` varchar(255) NOT NULL COMMENT '联系人/用户名',
  `linked_phone` varchar(255) NOT NULL COMMENT '电话',
  `deadline` varchar(19) NOT NULL COMMENT '当前充值后到期时间',
  `days` varchar(255) NOT NULL COMMENT '充值天数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值消费记录';

